import { motion } from 'framer-motion';
import Link from 'next/link';

export default () => {
  return (
    <motion.div
      initial={{ opacity: 0, x: '-10vh' }}
      animate={{ opacity: 1, x: 0 }}
      exit={{ opacity: 0, x: '10vh' }}
    >
      <div className="container bg-light p-5 text-center">
        <h1>PRESENTATION Component</h1>
        <Link href="/">
          <a>index</a>
        </Link>
      </div>
    </motion.div>
  );
};
